const Input = ({ label, type = 'text', name, placeholder, className, value, onChange, showPasswordToggle, showPassword, onTogglePassword }) => (
  <div className="flex flex-col mb-4">
      <label className="mb-2 font-semibold text-gray-700">{label}</label>
      <input
          type={type}
          name={name}
          placeholder={placeholder}
          className={`${className} p-3 border rounded-md`}
          value={value}
          onChange={onChange}
      />
      {showPasswordToggle && (
          <button type="button" onClick={onTogglePassword}>
              {showPassword ? 'Hide' : 'Show'} Password
          </button>
      )}
  </div>
);

export default Input;
